import { DeepMap } from '@clds/common-definitions';

import { BlendIntensity, BlendMode, BlendVariant } from './BlenderProps';
import {
  BackgroundBlendOptions,
  ColorName,
  ForegroundBlendOptions,
} from './blendOptions';

const map = (
  baseColor: ColorName,
  blendColor: ColorName,
  blendOpacity: BackgroundBlendOptions['blendOpacity'],
): BackgroundBlendOptions => ({
  baseColor,
  blendColor,
  blendOpacity,
});

const plainBackground = {
  primary: {
    sm: map('transparent', 'primary', 0.12),
    md: map('transparent', 'primary', 0),
    lg: map('transparent', 'primary', 0.06),
    xl: map('transparent', 'primary', 0.18),
  },
  secondary: {
    sm: map('transparent', 'contrastHigh', 0.12),
    md: map('transparent', 'contrastHigh', 0),
    lg: map('transparent', 'contrastHigh', 0.06),
    xl: map('transparent', 'contrastHigh', 0.18),
  },
  error: {
    sm: map('transparent', 'error', 0.12),
    md: map('transparent', 'error', 0),
    lg: map('transparent', 'error', 0.06),
    xl: map('transparent', 'error', 0.18),
  },
  success: {
    sm: map('transparent', 'success', 0.12),
    md: map('transparent', 'success', 0),
    lg: map('transparent', 'success', 0.06),
    xl: map('transparent', 'success', 0.18),
  },
  warning: {
    sm: map('transparent', 'warning', 0.12),
    md: map('transparent', 'warning', 0),
    lg: map('transparent', 'warning', 0.06),
    xl: map('transparent', 'warning', 0.18),
  },
  overlay: {
    sm: map('transparent', 'overlayLight', 0.12),
    md: map('transparent', 'overlayDark', 0),
    lg: map('transparent', 'overlayDark', 0.06),
    xl: map('transparent', 'overlayDark', 0.18),
  },
};
const surfaceBackground = {
  primary: {
    sm: map('surface', 'primary', 0.12),
    md: map('surface', 'primary', 0),
    lg: map('surface', 'primary', 0.06),
    xl: map('surface', 'primary', 0.18),
  },
  secondary: {
    sm: map('surface', 'contrastHigh', 0.12),
    md: map('surface', 'contrastHigh', 0),
    lg: map('surface', 'contrastHigh', 0.06),
    xl: map('surface', 'contrastHigh', 0.18),
  },
  error: {
    sm: map('surface', 'error', 0.12),
    md: map('surface', 'error', 0),
    lg: map('surface', 'error', 0.06),
    xl: map('surface', 'error', 0.18),
  },
  success: {
    sm: map('surface', 'success', 0.12),
    md: map('surface', 'success', 0),
    lg: map('surface', 'success', 0.06),
    xl: map('surface', 'success', 0.18),
  },
  warning: {
    sm: map('surface', 'warning', 0.12),
    md: map('surface', 'warning', 0),
    lg: map('surface', 'warning', 0.06),
    xl: map('surface', 'warning', 0.18),
  },
  overlay: {
    sm: map('overlayDark3', 'overlayLight', 0.12),
    md: map('overlayDark3', 'overlayDark', 0),
    lg: map('overlayDark3', 'overlayDark', 0.06),
    xl: map('overlayDark3', 'overlayDark', 0.18),
  },
};

export const backgroundMapping: DeepMap<
  [BlendMode, BlendVariant, BlendIntensity],
  BackgroundBlendOptions
> = {
  solidContrast: {
    primary: {
      sm: map('primary', 'contrastInvert', 0.12),
      md: map('primary', 'contrastInvert', 0),
      lg: map('primary', 'contrastHigh', 0.06),
      xl: map('primary', 'contrastHigh', 0.18),
    },
    secondary: {
      sm: map('secondary', 'contrastInvert', 0.12),
