    },
  },
  plainContrast: {
    ...plainBackground,
    overlay: {
      sm: map('transparent', 'contrastInvert', 0.12),
      md: map('transparent', 'contrastInvert', 0),
      lg: map('transparent', 'contrastInvert', 0.06),
